import { useEffect } from "react";
import Cards from "../../Components/Cards/Cards";
import { useDispatch } from "react-redux";
import { getDogs } from "../../Redux/actions";

const Home = ()=>{

  const dispatch = useDispatch();

    useEffect(()=>{
      dispatch(getDogs)
    },[])

    useDispatch

    return(
        <>
          <Cards/>
        </>
    )
}

export default Home;
